import React from 'react';
// import { Slide } from 'react-slideshow-image';
// import 'react-slideshow-image/dist/styles.css';
import "./Home.css";

import AliceCarousel from 'react-alice-carousel';
import "react-alice-carousel/lib/alice-carousel.css";
import image1 from './Images/img1';
import image2 from './Images/img2';
import image3 from './Images/img3';



 


 //const img1 ="https://www.dreamstime.com/photos-images/prem-mandir.html";
 const Home = () => {
          
          
              return (
                <div className="App">
     <AliceCarousel autoPlay autoPlayInterval="3000"> 
     <img src={img1} className="sliderimg" alt=""/> 
     <img src={img2} className="sliderimg"/>
     <img src={img3} className="sliderimg"/>
     
    </AliceCarousel>
    </div>
               

              )
          
                
        };
    export default Home;
